import Abstract from "./components/Abstract";
import ExperienceList from "./components/ExperienceList";
import FormationList from "./components/FormationList";
import Personal from "./components/Personal";
import Resume from "./components/Resume";
import SkillList from "./components/SkillList";

function App() {
  return (
    <div className="grid grid-cols-3 gap-4 w-full min-h-screen p-16">
      <div className='col-span-1 bg-yellow-400 flex flex-col'>
        <div className="flex">
          <Resume />
        </div>
        <div className="flex">
          <Personal />
        </div>
      </div>
      <div className='col-span-2 flex flex-col gap-4'>
        <div  className="flex bg-cyan-400 rounded">
          <Abstract />
        </div>
        <div className="flex bg-cyan-400 rounded">
          <FormationList />
        </div>
        <div className="flex bg-cyan-400 rounded">
          <ExperienceList />
        </div>
        <div className="flex bg-cyan-400 rounded">
          <SkillList />
        </div>
      </div>
    </div>
  );
}

export default App;
